import * as React from 'react';

import Box from '@mui/material/Box';
import Slider from '@mui/material/Slider';

export default function SliderSizes() {
  return (
    <Box width={300} marginTop={10}>
      <Slider pt={20} defaultValue={50} aria-label="Default" valueLabelDisplay="auto" />
			<Slider pt={50} defaultValue={50} aria-label="Default" valueLabelDisplay="auto" />
			<Slider pt={5} defaultValue={50} aria-label="Default" valueLabelDisplay="auto" />
			<Slider pt={5} defaultValue={50} aria-label="Default" valueLabelDisplay="auto" />
    </Box>
  );
}
